import styled from 'styled-components'

const StoryList = () => {
  const Paragraph = styled.p`
    font-size: 20px;
    border: none;
    margin-left: 200px;
    display: flex;
    flex-direction: column;
    justify-content: start;
    font-family: 'Courier New', Courier, monospace;
    font-style: italic;
    cursor: pointer;
  `
  return (
    <>
      <div>
        <Paragraph>{title}</Paragraph>
      </div>
    </>
  )
}

export default StoryList
